    protected class JapeInsertBreakAction extends RSyntaxTextAreaEditorKit.InsertBreakAction {
        protected JapeInsertBreakAction() {
        }

        public void actionPerformedImpl(ActionEvent e, RTextArea textArea) {
            if (textArea.isEditable() && textArea.isEnabled()) {
                RSyntaxTextArea rsta = (RSyntaxTextArea)this.getTextComponent(e);

                this.handleInsertBreak(rsta, true);

            } else {
                UIManager.getLookAndFeel().provideErrorFeedback(textArea);
            }
        }

        protected int getOpenBracketCount(RSyntaxDocument doc, int languageIndex, char bracketType) {
            int openCount = 0;
            Iterator var3 = doc.iterator();

            while(var3.hasNext()) {
                Token t = (Token)var3.next();
                if (t.getType() == 22 && t.length() == 1 && t.getLanguageIndex() == languageIndex) {
                    char ch = t.charAt(0);
                    if ((bracketType == '{' && ch == '{') || (bracketType == '(' && ch == '(')) {
                        ++openCount;
                    } else if ((bracketType == '{' && ch == '}') || (bracketType == '(' && ch == ')')) {
                        --openCount;
                    }
                }
            }

            return openCount;
        }

        @Override
        protected void possiblyCloseCurlyBrace(RSyntaxTextArea textArea, String leadingWS) {
            RSyntaxDocument doc = (RSyntaxDocument)textArea.getDocument();
            if (textArea.getCloseCurlyBraces()) {
                int line = textArea.getCaretLineNumber();
                Token t = doc.getTokenListForLine(line - 1);
                t = t.getLastNonCommentNonWhitespaceToken();
                if (t != null) {
                    int languageIndex = t.getLanguageIndex();
                    char ch = t.charAt(0);
                    if (doc.getCurlyBracesDenoteCodeBlocks(languageIndex) && this.getOpenBracketCount(doc, languageIndex, ch) > 0) {
                        StringBuilder sb = new StringBuilder();
                        if (line == textArea.getLineCount() - 1) {
                            sb.append('\n');
                        }

                        if (leadingWS != null) {
                            sb.append(leadingWS);
                        }

                        if (t.isLeftCurly()) {
                            sb.append("}\n");
                        } else {
                            ExtendedToken ext = (ExtendedToken)t;
                            if (ext.isLeftParenthesis()) {
                                sb.append(")\n");
                            }
                        }
                        int dot = textArea.getCaretPosition();
                        int end = textArea.getLineEndOffsetOfCurrentLine();
                        textArea.insert(sb.toString(), end);
                        textArea.setCaretPosition(dot);
                    }
                }
            }
        }
    }


